 * existing codes in the database. It uses a retry mechanism to handle 
 * potential collisions, with a maximum of 10 attempts.
 * 
 * The uniqueness constraint is enforced by the @@unique([code]) directive 
 * in the Prisma schema for the todo_list_channels table.
 * 
 * @returns A unique 8-character alphanumeric code
 * @throws {Error} If unable to generate a unique code after maximum retry attempts
 */
function generateCode(): string {
  const chars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
  let result = '';
  for (let i = 0; i < 8; i++) {
    result += chars.charAt(Math.floor(Math.random() * chars.length));
  }
  return result;
}

